    "great-dismal-swamp-national-wildlife-refuge-annual-narrative-report-calendar-year-1980",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Great
    Dismal Swamp National Wildlife Refuge outlines Refuge accomplishments during the
    1980 calendar year. The report begins by giving a brief introduction to the Refuge
    and describing the climate and habitat conditions in the Refuge, as well as the
    land acquisition program, funding and systems status. The construction and maintenance
    section describes recent construction, maintenance, and wildfires. The habitat management
    section discusses wetlands and forestlands. Wildlife- including endangered and threatened
    species, migratory birds, big game animals, furbearers, predators, fish, and raptors-
    are discussed. The public relations section discusses information and interpretation,
    recreational uses, and enforcement. Field investigations, cooperative programs,
    items of interest, and safety are discussed. Photographs are attached.",nt"license_title":
